pragma solidity ^0.7.1;
//SPDX-License-Identifier: UNLICENSED

import "./Interfaces/ITrustAnchorManager.sol";
import "./Interfaces/ITrustChannelManager.sol";

import "./Administrable.sol";

/// @author Chris Forrester, 2018+ Shyft. all rights reserved.

/// @dev
/// | The Trust Channel Manager is an interface for Trust Anchors to collaborate and share directed financial communications channels in as close to a friction-free way as possible.
/// |
/// | Trust Anchors sign up to collaborate on the Trust Channel, assigning rules that must be in place to allow for the interface to function. Verifiability of documentation is a key differentiating factor from other identity solutions.
/// |
/// | Technically, the Trust Channel contract acts as a service-interface aggregator, relying heavily on bit-field manipulation to associate the DAG (directed acyclic graph) relations of the participating trust anchor efficiently.
/// |
/// | This process creates bounds on logic, as lookup tables increase linearly.
/// |
/// | Within this flow, the Trust Channels are initially set up by the administrators of this smart contract and within each Trust Channel is the ability to add "Trust Channel Administrators", who can manage the membership of each Trust Channel.
/// |
/// | Some notes: Administrators of Trust Channels do not need to be Trust Anchors.
/// | Trust Anchors assigned to Trust Channels must be verified Trust Anchors.
/// | When Trust Anchors are added to a Trust Channel by the administrators of that Trust Channel, the Trust Anchor's Jurisdiction is added to the mapping of allowed Jurisdictions in the Trust Channel's routing functionality.
/// @notice
/// As this methodology evolves, Bloom filters could theoretically be utilized to allow a probablistic pathing that might need to have heavier lookups in the future.


//@note:@todo:@next: examine the use of a de-facto "global id type" section, with Shyft running the
// attestor component via reading certificate-equivalents from signed messages having a valid
// certificate from some third-party entity.
//
// second forms of identity may be used and collected like PGP methods.


//@note:@todo:@next: structurally we would want the channel rules to be able to specify what tokens are able to be
// transferred on what channel. Checking for which routes are available could be done before any messages need to be passed.

contract TrustChannelManager is Administrable, ITrustChannelManager {
    // ** trust channel management ** //

    /// @dev Event for the setup of a new Trust Channel.
    event EVT_SetupTrustChannel(address _trustChannelAddress,
                                address _primaryAdminAddress,
                                bool _activateByDefault,
                                bytes32 trustChannelKeccak,
                                uint256 numTrustChannels);

    /// @dev Event for the activation of a Trust Channel.
    event EVT_ActivateTrustChannel(address _trustChannelAddress);

    /// @dev Event for the deactivation of a Trust Channel.
    event EVT_DeactivateTrustChannel(address _trustChannelAddress);

    /// @dev Event for the check of whether the given address is a Trust Channel administrator.
    event EVT_IsTrustChannelAdministrator(  address _trustChannelAdministratorAddress,
                                            address _trustChannelAddress,
                                            bool isTrustChannelAdministrator);

    /// @dev Event for the retrieval of a Jurisdiction from a Trust Anchor.
    event EVT_ReceivedJurisdictionFromTrustAnchor(  uint16 jurisdiction,
                                                    address trustAnchorAddress,
                                                    address trustChannelAddress );

    /// @dev Event for the creation of a new Trust Channel with a given Trust Anchor.
    event EVT_ComposedTrustChannelWithTrustAnchor(  uint256 composedBitField,
                                                    uint32 trustAnchorIndex,
                                                    uint32 trustChannelIndex,
                                                    address _trustAnchorAddress,
                                                    address _trustChannelAddress );

    /// @dev Event for the addition of a Trust Anchor to a Trust Channel.
    event EVT_AddedTrustAnchorToTrustChannel(   uint256 ruleStorageIndex,
                                                uint24 trustChannelLowestSubmapNumber,
                                                uint24 trustChannelHighestSubmapNumber,
                                                uint256 numTrustChannelsAssociatedToThisTrustAnchor,
//                                                uint32 trustAnchorIndex,
                                                address _trustAnchorAddress,
                                                address _trustChannelAddress );

    /// @dev Event for the removal of a Trust Anchor to a Trust Channel.
    event EVT_RemovedTrustAnchorFromTrustChannel(   uint256 trustChannelIndexBitField,
                                                    uint32 trustAnchorIndex,
                                                    uint32 trustChannelIndex,
                                                    address _trustAnchorAddress,
                                                    address _trustChannelAddress);

    /// @dev Struct for the Trust Channel Map.
    struct trustChannelMap {
        bool isActive;
        bool doesExist;
        mapping(address => bool) trustAnchorAddressExists;

        uint32[] trustAnchorsArray;
        mapping(uint32=>uint256) trustAnchorsArrayPositionMapping;
//        uint256[] trustAnchorIndexMapEXBitField;

        trustChannelRules channelRules;
    }

    /// @dev simple constant for "no link" to cut down on runtime gas costs.
    uint32 NO_LINK = 2**32-1;

    /// @dev Mapping of Trust Channel addresses to a Trust Channel hash value.
    mapping(address => bytes32) trustChannelAddressToTrustChannelKeccak;

    /// @dev Mapping of Trust Channel hash to a Trust Channel Trust Channel Map struct.
    mapping(bytes32 => trustChannelMap) trustChannelKeccakToTrustChannelMap;

    /// @dev Number of Trust Channels in this contract.
    uint32 public numTrustChannels;

    /// @dev Mapping of administrators that exist in this Trust Channel.
    mapping(address => mapping(address => bool)) trustChannelAdministratorExistsMapping;

    /// @dev Mapping of administrators that by integer Index in this Trust Channel.
    mapping(address => mapping(address => uint64)) trustChannelAdministratorsIndexMapping;

    /// @dev Mapping of administrators array in a Trust Channel.
    mapping(address => address[]) trustChannelAdministratorsArray;

    /// @dev Mapping of number of administrators in a Trust Channel.
    mapping(address => uint256) numActiveTrustChannelAdministrators;

    /// @dev Mapping of a Trust Channel address to the Trust Channel Key Permissions (for multi-sig via key-value hash).
    mapping (address => mapping(bytes32 => trustChannelKeyPermissions)) trustChannelAdministratorMultisignPermissionedKeys;

    /// @dev Mapping of a Trust Channel address to the Trust Channel Key Permissions array (for multi-sig via key-value hash).
    mapping (address => mapping(address => bytes32[])) trustChannelAdministratorToMultisignPermissionedKeysArray;

    /// @dev | Struct of the Key Permissions (for multi-sig via key-value hash) for Trust Channel administrators.
    ///      | This functions nearly identical to the Administrable contract's methods.
    struct trustChannelKeyPermissions {
        mapping(address => KeyPermissionAccess) trustChannelAdministratorSignatures;
        address[] trustChannelAdministrators;

        uint256 permissionLevel;
    }

    /// @dev | Mapping of a Trust Channel address to the Trust Channel Indexed Bit Field, within a 256-bit "Sub-map" of the Trust Channels.
    ///      | This is an array of 0 & 1's that correspond to Trust Channel that have been added to this contract, corresponding to the Index per Trust Channel (first Trust Channel is the first bit, etc.)
    ///      | Internally, the Shyft Core architecture's Route functionality is the most efficient per-32 bits (each bit representing an Indexed Trust Channel), with another performance (gas) benefit with the first 256 bits being most efficient, the second 256 bits being slightly less, and so on.
    mapping(uint32 => mapping(uint24 => uint256)) trustAnchorIndexToTrustChannelIndexBitField;

    /// @dev Mapping of whether a Trust Anchor (by Index) is associated to any Trust Channels.
    mapping(uint32 => bool) trustAnchorIndexAssociatedToAnyTrustChannels;

    /// @dev Mapping of Trust Anchor (by Index) to the number of Trust Channels it is associated to.
    mapping(uint32 => uint256) trustAnchorIndexNumberOfTrustChannelsAssociated;

    /// @dev Mapping of the Trust Anchor (by Index) to the "Lowest Sub-map Number", which is the lowest Trust Channel "Sub-map" (256 bits) that this Trust Anchor is associated to.
    mapping(uint32 => uint24) trustAnchorIndexToTrustChannelLowestSubmapNumber;

    /// @dev Mapping of the Trust Anchor (by Index) to the "Highest Sub-map Number", which is the highest Trust Channel "Sub-map" (256 bits) that this Trust Anchor is associated to.
    mapping(uint32 => uint24) trustAnchorIndexToTrustChannelHighestSubmapNumber;

    /// @dev | Struct for Trust Anchor Associations
    ///      | Per Trust Anchor Index, an array of Trust Channel Indexes that this Trust Anchor is associated to, and, per Trust Anchor Index, an array of Trust Channel Indexes Mappings for array swap support on removal of this Trust Address from Trust Channels it is associated to.
    /// @notice since Solidity doesn't really allow for re-sorting arrays, any of these that are removed later on will be marked as 2**32-1 (as trust channel 0 is a valid number).
    struct trustAnchorAssociations {
        uint32[] associatedTrustChannelIndexesArray;
        mapping(uint32 => uint256) associatedTrustChannelIndexesMapping;
    }

    /// @dev Mapping of the Trust Anchor Index to associations to that Trust Anchor.
    mapping(uint32 => trustAnchorAssociations) trustAnchorIndexToAssociations;

    /// @dev Mapping of the Trust Channel Index to the Trust Channel Hash
    mapping(uint32 => bytes32) trustChannelIndexToTrustChannelKeccak;

    /// @dev Mapping of the Trust Channel Hash to the Trust Channel Index
    mapping(bytes32 => uint32) trustChannelKeccakToTrustChannelIndex;

    /// @dev Mapping of the Trust Channel Index to the Trust Channel Address
    mapping(uint32 => address) trustChannelIndexToTrustChannelAddress;

    /// @dev Base constant for no Jurisdiction set, the default for all Verified Trust Anchors.
    uint16 constant NoJurisdiction = 2 ** 16 - 1;

    /// @dev Address for the Trust Anchor Manager that is linked to this contract.
    address public trustAnchorManagerAddress;

    /// @dev Address for the Trust Anchor Storage that is linked to this contract.
    address public trustAnchorStorageAddress;

    /// @dev Initializes Trust Channel Manager with the owner set to the calling public address.

    constructor() {
        owner = msg.sender;
    }

    //@note:@here:@todo:@next: setup the following two functions to be multisig through Administrable, and write tests
    // to match.

    /// @param _trustAnchorManagerAddress The smart contract address for the Trust Anchor Manager that should be linked.
    /// @dev | Links Trust Anchor Manager to this contract's function flow.
    ///      | Uses Multi-signature permissions.
    /// @return result
    ///    | 0: not an administrator
    ///    | 1: not enough administrators have permissioned change
    ///    | 2: set trust anchor manager address

    function setTrustAnchorManagerAddress(address _trustAnchorManagerAddress) public returns (uint8 result) {
      require(_trustAnchorManagerAddress != address(0));

      if (isAdministrator(msg.sender)) {
          bytes32 keyKeccak = keccak256(abi.encodePacked("trustAnchorManagerAddress", _trustAnchorManagerAddress));

          uint256 numPermissions = getPermissionsForMultisignKey(keyKeccak);

          bool permittedToModify;

          if (numPermissions >= adminConfirmationThreshold) {
              permittedToModify = true;
          } else {
              uint256 numConfirmedPermissions = adminApplyAndGetPermissionsForMultisignKey(keyKeccak);

              if (numConfirmedPermissions >= adminConfirmationThreshold) {
                  permittedToModify = true;
              }
          }

          if (permittedToModify == true) {
              trustAnchorManagerAddress = _trustAnchorManagerAddress;

              adminResetPermissionsForMultisignKey(keyKeccak);

              // set trust anchor manager address
              return 2;

          } else {
              // not enough administrators have permissioned change
              return 1;
          }
      } else {
          // not an administrator
          return 0;
      }
    }


    /// @param _trustAnchorStorageAddress The smart contract address for the Trust Anchor Storage that should be linked.
    /// @dev | Links Trust Anchor Storage to this contract's function flow.
    ///      | Uses Multi-signature permissions.
    /// @return result
    ///    | 0: not an administrator
    ///    | 1: not enough administrators have permissioned change
    ///    | 2: set trust anchor storage address

    function setTrustAnchorStorageAddress(address _trustAnchorStorageAddress) public returns (uint8 result) {
        require(_trustAnchorStorageAddress != address(0));

        if (isAdministrator(msg.sender)) {
            bytes32 keyKeccak = keccak256(abi.encodePacked("trustAnchorStorageAddress", _trustAnchorStorageAddress));

            uint256 numPermissions = getPermissionsForMultisignKey(keyKeccak);

            bool permittedToModify;

            if (numPermissions >= adminConfirmationThreshold) {
                permittedToModify = true;
            } else {
                uint256 numConfirmedPermissions = adminApplyAndGetPermissionsForMultisignKey(keyKeccak);

                if (numConfirmedPermissions >= adminConfirmationThreshold) {
                    permittedToModify = true;
                }
            }

            if (permittedToModify == true) {
                trustAnchorStorageAddress = _trustAnchorStorageAddress;

                adminResetPermissionsForMultisignKey(keyKeccak);

                // set trust anchor storage address
                return 2;

            } else {
                // not enough administrators have permissioned change
                return 1;
            }
        } else {
            // not an administrator
            return 0;
        }
    }


    /// @param _trustAnchorAddress The smart contract address that is checked for Verified status.
    /// @dev | Checks whether a Trust Anchor is verified, using a public address. Uses the Trust Anchor Manager linkage to return results.
    /// @return result
    ///    | false = not verified
    ///    | true = is verified

    function isTrustAnchorVerified(address _trustAnchorAddress) internal view returns (bool result){
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        if (trustAnchorManager.isTrustAnchorVerified(_trustAnchorAddress)) {
            //verified address
            return true;
        } else {
            //address not verified
            return false;
        }
    }


    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @param _primaryAdminAddress The address for the primary administrator for this Trust Channel.
    /// @param _activateByDefault A boolean signifying whether this Trust Channel is activated by default.
    /// @dev | Creates up a new Trust Channel.
    ///      | The identifier for the Trust Channel is any ethereum-compatible address (to allow for off-chain verification of Trust Channel ownership rights via signature, for example). The Primary administrator is set, with an additional variable to signify whether this Trust Channel is activated by default (could be used delaying the ultimate activation of this Trust Channel until other parameters have been set).
    ///      | This function is called by administrators of this smart contract.
    ///      | Uses Multi-signature permissions.
    /// @return result
    ///    | 0 = not an administrator
    ///    | 1 = not enough administrators have permissioned change
    ///    | 2 = trust channel already exists
    ///    | 3 = added trust channel

    function adminSetupTrustChannel(address _trustChannelAddress, address _primaryAdminAddress, bool _activateByDefault) public returns (uint8 result) {
        if (isAdministrator(msg.sender)) {
            bytes32 keyKeccak = keccak256(abi.encodePacked("adminSetupTrustChannelVote", _trustChannelAddress, _primaryAdminAddress, _activateByDefault));

            uint256 numPermissions = getPermissionsForMultisignKey(keyKeccak);

            bool permittedToModify;

            if (numPermissions >= adminConfirmationThreshold) {
                permittedToModify = true;
            } else {
                uint256 numConfirmedPermissions = adminApplyAndGetPermissionsForMultisignKey(keyKeccak);

                if (numConfirmedPermissions >= adminConfirmationThreshold) {
                    permittedToModify = true;
                }
            }

            if (permittedToModify == true) {
                //@note:@here:@future perhaps this should be modified so that any particular ethereum address can own
                // multiple trust channels?
                bytes32 trustChannelKeccak = keccak256(abi.encodePacked(_trustChannelAddress));
                trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelKeccak];

                adminResetPermissionsForMultisignKey(keyKeccak);

                //@note:@here:@todo:@critical: when channel is mapped to "false", maybe it's far better to have the
                // trust channel keccak as an indexed version hash -> it would never collide and there would be the
                // ability to have historic proofs re: storage trie proof on latest confirmed block <3

                if (channelMap.doesExist == false) {
                    channelMap.doesExist = true;
                    channelMap.isActive = _activateByDefault;
                    channelMap.channelRules.isActive = true;
                    channelMap.channelRules.trustChannelKeccak = trustChannelKeccak;
                    channelMap.channelRules.rulesActive |= uint256(2)**uint8(trustChannelRulesEnum.VerificationPolicyEnforced);
//                    channelMap.channelRules.rulesActive |= 2**uint8(trustChannelRulesEnum.AllowTransitAcrossOtherChannels);
                    //keccack256(trustChannelKeccak, TrustChannelRules.AllowTransitAcrossOtherChannels, "A")
//                    channelMap.channelRules.rulesActive |= 2**uint8(trustChannelRulesEnum.AllowTransitAcrossJurisdictions);
//                    channelMap.channelRules.rulesActive |= 2**uint8(trustChannelRulesEnum.MinimumSyntheticKycLevelRequired);
//                    channelMap.channelRules.rulesActive |= 2**uint8(trustChannelRulesEnum.AmountLimitsEnforced);
                    //keccack256(trustChannelKeccak, TrustChannelRules.AllowTransitAcrossJurisdiction, "A")

                    trustChannelAddressToTrustChannelKeccak[_trustChannelAddress] = trustChannelKeccak;

                    trustChannelKeccakToTrustChannelIndex[trustChannelKeccak] = numTrustChannels;
                    trustChannelIndexToTrustChannelKeccak[numTrustChannels] = trustChannelKeccak;
                    trustChannelIndexToTrustChannelAddress[numTrustChannels] = _trustChannelAddress;

                    //setup the base administrator for this trust channel.
                    trustChannelAdministratorExistsMapping[_trustChannelAddress][_primaryAdminAddress] = true;
                    trustChannelAdministratorsIndexMapping[_trustChannelAddress][_primaryAdminAddress] = 0;
                    trustChannelAdministratorsArray[_trustChannelAddress].push(_primaryAdminAddress);

                    numActiveTrustChannelAdministrators[_trustChannelAddress] = 1;

                    numTrustChannels++;

                    emit EVT_SetupTrustChannel(_trustChannelAddress, _primaryAdminAddress, _activateByDefault, trustChannelKeccak, numTrustChannels);

                    //added trust channel
                    return 3;
                } else {
                    //trust channel already exists
                    return 2;
                }
            } else {
                // not enough administrators have permissioned change
                return 1;
            }
        } else {
            // not an administrator
            return 0;
        }
    }


    /// @param _trustChannelAdministratorAddress The address for an administrator for this Trust Channel.
    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @dev Checks whether any specific administrator has permissions to administrate the Trust Channel specified.
    /// @return result
    ///    | false = not trust channel administrator
    ///    | true = is trust channel administrator

    function isTrustChannelAdministrator(address _trustChannelAdministratorAddress,
                                         address _trustChannelAddress) public view override returns (bool result) {
//        emit EVT_IsTrustChannelAdministrator(_trustChannelAdministratorAddress, _trustChannelAddress, trustChannelAdministratorExistsMapping[_trustChannelAddress][_trustChannelAdministratorAddress]);
        if (trustChannelAdministratorExistsMapping[_trustChannelAddress][_trustChannelAdministratorAddress] == true) {
            //is trust channel administrator
            return true;
        } else {
            //not trust channel administrator
            return false;
        }
    }

    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @param _index The Index for the administrator for this Trust Channel specified via the Index inside of the array of administrators assigned to this Trust Channel.
    /// @dev Checks whether any specific administrator has permissions to administrate the Trust Channel specified.
    /// @notice For mapping, if a value is passed that does not exist in the mapping array, the response will be an address(0).
    /// @return result
    ///    | address(0) = no trust channel administrator found for this specific index
    ///    | [address] = address of trust channel administrator

    function getTrustChannelAdministratorForTrustChannelByIndex(address _trustChannelAddress,
                                                                uint64 _index) public view override returns (address result) {
        if (trustChannelAdministratorsArray[_trustChannelAddress].length > _index) {
            return trustChannelAdministratorsArray[_trustChannelAddress][_index];
        } else {
            //not no trust channel administrator found
            return address(0);
        }
    }


    //@note: general administrators are not allowed in this build.
//
//    //only general administrators should be able to add admins to any trust channel without reaching threshold
//    //
//    // 0 = not an administrator
//    // 1 = already a trust channel administrator for this trust channel
//    // 2 = set new trust channel administrator for this trust channel
//
//    function administratorAddTrustChannelAdministrator(address _newTrustChannelAdministratorAddress, address _trustChannelAddress) public returns (uint8 result) {
//        if (isAdministrator(msg.sender)) {
//            if (isTrustChannelAdministrator(_newTrustChannelAdministratorAddress, _trustChannelAddress) == false) {
//                trustChannelAdministratorExistsMapping[_trustChannelAddress][_newTrustChannelAdministratorAddress] = true;
//                trustChannelAdministratorsIndexMapping[_trustChannelAddress][_newTrustChannelAdministratorAddress] = uint64(trustChannelAdministratorsArray[_trustChannelAddress].length);
//                trustChannelAdministratorsArray[_trustChannelAddress].push(_newTrustChannelAdministratorAddress);
//                numActiveTrustChannelAdministrators[_trustChannelAddress] += 1;
//
//                //set new trust channel administrator for this trust channel
//                return 2;
//            } else {
//                //already a trust channel administrator for this trust channel
//                return 1;
//            }
//
//        } else {
//
//            //not trust channel administrator
//            return 0;
//        }
//    }
//
//    //returns:
//    // 0 = not trust channel administrator
//    // 1 = trust channel administrator doesn't exist for this trust channel
//    // 1 = trust channel administrator removed for this trust channel
//
//    //@note:@todo:@internalaudit: does this work better if we had a multisig equivalent for the channel administrators?
//    //@note:@todo:@test: write tests surrounding this function.
//    function administratorRemoveChannelAdministrator(address _trustChannelAdministratorAddressToRemove,
//                                                                 address _trustChannelAddress) public returns (uint8 result) {
//        if (isAdministrator(msg.sender) == true) {
//            if (isTrustChannelAdministrator(_trustChannelAdministratorAddressToRemove, _trustChannelAddress) == true) {
//                trustChannelAdministratorExistsMapping[_trustChannelAddress][_trustChannelAdministratorAddressToRemove] = false;
//
//                //clear out the trust channel administrator association at a specific index so that the getter for the
//                // trust channel administrators at index N returns a zero address.
//                uint64 index = trustChannelAdministratorsIndexMapping[_trustChannelAddress][_trustChannelAdministratorAddressToRemove];
//                trustChannelAdministratorsArray[_trustChannelAddress][index] = address(0);
//                numActiveTrustChannelAdministrators[_trustChannelAddress] -= 1;
//
//                //trust channel administrator removed for this trust channel
//                return 2;
//            } else {
//                //trust channel administrator doesn't exist for this trust channel
//                return 1;
//            }
//        } else {
