//            return 0;
//        }
//    }
//


    /// @param _newTrustChannelAdministratorAddress The address for an administrator for this Trust Channel.
    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @dev | Adds a new administrator to this Trust Channel. Called by existing administrators of this Trust Channel.
    ///      | Uses Multi-signature permissions.
    /// @return result
    ///    | 0 = not a trust channel administrator
    ///    | 1 = already a trust channel administrator for this trust channel
    ///    | 2 = added vote to set new trust channel administrator for this trust channel
    ///    | 3 = set new trust channel administrator for this trust channel

    function trustChannelAdministratorAddTrustChannelAdministrator(address _newTrustChannelAdministratorAddress,
                                                                   address _trustChannelAddress) public returns (uint8 result) {

        if (isTrustChannelAdministrator(msg.sender, _trustChannelAddress) == true) {
            if (isTrustChannelAdministrator(_newTrustChannelAdministratorAddress, _trustChannelAddress) == false) {
                //@note:@here:@todo:@critical: this is now dependant on the upper level contract to dictate multisig rules, needs
                // to change immediately bc if top level sets threshold to 3 and there's previously only 2 admins, there could be
                // many issues. "adminConfirmationThreshold" should be local to the trust channel admins.

                bool doProceed = true;

                if (numActiveTrustChannelAdministrators[_trustChannelAddress] > 1) {
                    bytes32 keyKeccak = keccak256(abi.encodePacked("addTrustChannelAdministratorVote", _newTrustChannelAdministratorAddress, _trustChannelAddress));
                    uint256 multisignResult = trustChannelAdminApplyAndGetPermissionsForMultisignKey(_trustChannelAddress, keyKeccak);

                    if (multisignResult < adminConfirmationThreshold) {
                        doProceed = false;
                    }
                }

                if (doProceed == true) {
                    trustChannelAdministratorExistsMapping[_trustChannelAddress][_newTrustChannelAdministratorAddress] = true;
                    trustChannelAdministratorsIndexMapping[_trustChannelAddress][_newTrustChannelAdministratorAddress] = uint64(trustChannelAdministratorsArray[_trustChannelAddress].length);
                    trustChannelAdministratorsArray[_trustChannelAddress].push(_newTrustChannelAdministratorAddress);
                    numActiveTrustChannelAdministrators[_trustChannelAddress] += 1;

                    //set new trust channel administrator for this trust channel
                    return 3;
                } else {
                    //added vote to set new trust channel administrator for this trust channel
                    return 2;
                }
            } else {
                //already a trust channel administrator for this trust channel
                return 1;
            }
        } else {
            //not a trust channel administrator
            return 0;
        }
    }


    /// @param _trustChannelAdministratorAddressToRemove The address for an administrator for this Trust Channel that should be removed from this Trust Channel's administrators.
    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @dev | Removes an administrator to this Trust Channel. Called by existing administrators of this Trust Channel.
    ///      | Uses Multi-signature permissions.
    /// @return result
    ///    | 0 = not trust channel administrator
    ///    | 1 = trust channel administrator doesn't exist for this trust channel
    ///    | 2 = needs more administrator votes
    ///    | 3 = trust channel administrator removed for this trust channel

    function trustChannelAdministratorRemoveTrustChannelAdministrator(address _trustChannelAdministratorAddressToRemove,
                                                                      address _trustChannelAddress) public returns (uint8 result) {
        if (isTrustChannelAdministrator(msg.sender, _trustChannelAddress)) {
            if (isTrustChannelAdministrator(_trustChannelAdministratorAddressToRemove, _trustChannelAddress) == true) {
                //@note:@here:@todo:@critical: this is now dependant on the upper level contract to dictate multisig rules, needs
                // to change immediately bc if top level sets threshold to 3 and there's previously only 2 admins, there could be
                // many issues. "adminConfirmationThreshold" should be local to the trust channel admins.

                bool doProceed = true;

                if (numActiveTrustChannelAdministrators[_trustChannelAddress] > 1) {
                    bytes32 keyKeccak = keccak256(abi.encodePacked("revokeTrustChannelAdministratorVote", _trustChannelAdministratorAddressToRemove, _trustChannelAddress));
                    uint256 multisignResult = trustChannelAdminApplyAndGetPermissionsForMultisignKey(_trustChannelAddress, keyKeccak);

                    if (multisignResult < adminConfirmationThreshold) {
                        doProceed = false;
                    }
                }

                if (doProceed == true) {
                    trustChannelAdministratorExistsMapping[_trustChannelAddress][_trustChannelAdministratorAddressToRemove] = false;
                    uint64 index = trustChannelAdministratorsIndexMapping[_trustChannelAddress][_trustChannelAdministratorAddressToRemove];
                    trustChannelAdministratorsArray[_trustChannelAddress][index] = address(0);
                    numActiveTrustChannelAdministrators[_trustChannelAddress] -= 1;

                    //@note:@todo:@here:@critical: for local confirmation threshold, reduce said threshold if there
                    // are not enough admins.
                    //@note: cannot remove past the multisig limit.
                    // like "revokeAdministrator" in "Administrable.sol"

                    //trust channel administrator removed for this trust channel
                    return 3;
                } else {
                    //needs more administrator votes
                    return 2;
                }
            } else {
                //trust channel administrator doesn't exist for this trust channel
                return 1;
            }
        } else {
            //not trust channel administrator
            return 0;
        }
    }


    // @note re: removal of trust channels
    // thoughts; you'd be able to process offline the users affected by that trust channel, and manually remove the trust channel
    // from each, and from all of the trust anchors that it had been associated to. After that, it could be re-assigned.
    // this could be a very heavy gas costs #statisticalmodelling.

    // it should work fine across time & scale, the earlier channels can be rearranged and interestingly become commodities for
    // guaranteed faster access/transport time (since the mapping speed is faster with the lower indexes).

    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @dev | Deactivates a Trust Channel. Deactivating rather than removing the Trust Channel enables the routing function(s) to quickly determine pass/fail conditions. Called by administrators of this smart contract.
    ///      | Uses Multi-signature permissions.
    /// @return result
    ///    | 0 = not administrator
    ///    | 1 = not enough administrators have permissioned change
    ///    | 2 = trust channel deactivated

    function adminDeactivateTrustChannel(address _trustChannelAddress) public returns (uint8 result) {
       if (isAdministrator(msg.sender)) {
           bytes32 keyKeccak = keccak256(abi.encodePacked("deactivateTrustChannel", _trustChannelAddress));

           uint256 numPermissions = getPermissionsForMultisignKey(keyKeccak);

           bool permittedToModify;

           if (numPermissions >= adminConfirmationThreshold) {
               permittedToModify = true;
           } else {
               uint256 numConfirmedPermissions = adminApplyAndGetPermissionsForMultisignKey(keyKeccak);

               if (numConfirmedPermissions >= adminConfirmationThreshold) {
                   permittedToModify = true;
               }
           }

           if (permittedToModify == true) {
               bytes32 trustChannelKeccak = keccak256(abi.encodePacked(_trustChannelAddress));

               trustChannelKeccakToTrustChannelMap[trustChannelKeccak].isActive = false;

               adminResetPermissionsForMultisignKey(keyKeccak);

               emit EVT_DeactivateTrustChannel(_trustChannelAddress);

               //trust channel deactivated
               return 2;
           } else {
               //not enough administrators have permissioned change
               return 1;
           }
       } else {
           //not an administrator
           return 0;
       }
    }


    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @dev | Reactivates a previously deactivated Trust Channel. Called by administrators of this smart contract.
    ///      | Uses Multi-signature permissions.
    /// @return result
    ///    | 0 = not administrator
    ///    | 1 = not enough administrators have permissioned change
    ///    | 2 = trust channel rules do not allow reactivation
    ///    | 3 = trust channel reactivated

    function adminReactivateTrustChannel(address _trustChannelAddress) public returns (uint8 result) {
        if (isAdministrator(msg.sender)) {
            bytes32 keyKeccak = keccak256(abi.encodePacked("reactivateTrustChannel", _trustChannelAddress));

            uint256 numPermissions = getPermissionsForMultisignKey(keyKeccak);

            bool permittedToModify;

            if (numPermissions >= adminConfirmationThreshold) {
                permittedToModify = true;
            } else {
                uint256 numConfirmedPermissions = adminApplyAndGetPermissionsForMultisignKey(keyKeccak);

                if (numConfirmedPermissions >= adminConfirmationThreshold) {
                    permittedToModify = true;
                }
            }

            if (permittedToModify == true) {
                bytes32 trustChannelKeccak = keccak256(abi.encodePacked(_trustChannelAddress));
                trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelKeccak];

                adminResetPermissionsForMultisignKey(keyKeccak);

                if (channelMap.doesExist == true) {
                    channelMap.isActive = true;

                    emit EVT_ActivateTrustChannel(_trustChannelAddress);

                    //trust channel reactivated
                    return 3;
                } else {
                    //trust channel rules do not allow reactivation
                    return 2;
                }
            } else {
                //not enough administrators have permissioned change
                return 1;
            }
        } else {
            //not an administrator
            return 0;
        }
    }


    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @param _keyKeccak A hash of the key-value store that the administrators of Trust Channels can sign off on.
    /// @dev Administrator this function applies multisig functionality for the administrators of specific Trust Channels.
    /// @return result whether to proceed with the functions that call this relating to the hash of the key-value store

    function requireAndApplyTrustChannelAdministratorsConfirmation(address _trustChannelAddress, bytes32 _keyKeccak) public returns (bool result) {
        //@note:@here:@todo:@critical: this is now dependant on the upper level contract to dictate multisig rules, needs
        // to change immediately bc if top level sets threshold to 3 and there's previously only 2 admins, there could be
        // many issues. "adminConfirmationThreshold" should be local to the trust channel admins.

        bool doProceed = true;

        if (numActiveTrustChannelAdministrators[_trustChannelAddress] > 1) {
            uint256 multisignResult = trustChannelAdminApplyAndGetPermissionsForMultisignKey(_trustChannelAddress, _keyKeccak);

            if (multisignResult < adminConfirmationThreshold) {
                doProceed = false;
            }
        }

        //whether to proceed with the functions that call this relating to the hash of the key-value store
        return doProceed;
    }


    //@note:@next:@todo:@internalaudit: what happens to the existing users of the trust anchor (w / prior attestations) when the
    // trust anchor is associated to this new trust channel. ie are new attestations required?
    //
    //@response: I'd assume that this is so.

    /// @param _trustAnchorAddress The address of a Trust Anchor.
    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @dev | Adds a Trust Anchor to a Trust Channel. Called by administrators of this Trust Channel.
    ///      | The Trust Anchor must have been previously Onboarded + Verified + set their Jurisdiction through the Trust Anchor Manager contract that this contract is linked to.
    ///      | Uses Multi-signature permissions.
    /// @return result
    ///    | 0 = not trust channel administrator
    ///    | 1 = requires more administrator votes
    ///    | 2 = trust channel not active
    ///    | 3 = trust anchor already within mapping
    ///    | 4 = could not set up trust anchor (trust anchor has not been onboarded + verified and then has set their jurisdiction)
    ///    | 5 = trust anchor added to trust channel

    function trustChannelAdministratorAddTrustAnchorToTrustChannel( address _trustAnchorAddress,
                                                                    address _trustChannelAddress) public returns (uint8 result) {
        if (isTrustChannelAdministrator(msg.sender, _trustChannelAddress) == true) {
            bytes32 keyKeccak = keccak256(abi.encodePacked("addTrustAnchorToTrustChannelVote", _trustAnchorAddress, _trustChannelAddress));

            if (requireAndApplyTrustChannelAdministratorsConfirmation(_trustChannelAddress, keyKeccak) == true) {
                bytes32 trustChannelKeccak = trustChannelAddressToTrustChannelKeccak[_trustChannelAddress];
                trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelKeccak];

                trustChannelAdminResetPermissionsForMultisignKey(_trustChannelAddress, keyKeccak);

                if (channelMap.isActive == true) {
                    if (channelMap.trustAnchorAddressExists[_trustAnchorAddress] == false) {
                        bool setupResult = setupTrustChannelWithNewTrustAnchor(_trustAnchorAddress, _trustChannelAddress, channelMap);

                        if (setupResult == true) {
                            //trust anchor added to trust channel

                            return 5;
                        }  else {
                            //could not set up trust anchor (trust anchor has not been onboarded + verified and then has set their jurisdiction)
                            return 4;
                        }
                    } else {
                        //trust anchor already within mapping
                        return 3;
                    }
                } else {
                    //trust channel not active
                    return 2;
                }
            } else {
                //requires more administrator votes
                return 1;
            }
        } else {
            //not channel administrator
            return 0;
        }
    }

    /// @param _trustAnchorAddress The address of a Trust Anchor.
    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @param _channelMap A [storage] struct passed in which associates with a particular Trust Channel.
    /// @dev | Internal function that performs the addition of a Trust Anchor to a Trust Channel.
    ///      | The Trust Anchor must have been previously Onboarded + Verified + set their Jurisdiction through the Trust Anchor Manager contract that this contract is linked to.
    /// @return result
    ///    | false = no trust anchor jurisdiction set (trust anchor may not have been onboarded + verified either)
    ///    | true = trust anchor added to trust channel

    function setupTrustChannelWithNewTrustAnchor(address _trustAnchorAddress, address _trustChannelAddress, trustChannelMap storage _channelMap) internal returns (bool result) {
        //@note: need to check trust anchor jurisdiction in trust anchor manager lookup
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        //@note: the only way that a jurisdiction can be set is for the Trust Anchor to call the TrustAnchorManager contract *after* they have been Onboarded+Verified by the administrators of that contract.
        // so a Trust Anchor that doesn't exist in the Shyft Core architecture will have no jurisdiction set.
        uint16 jurisdiction = trustAnchorManager.getTrustAnchorJurisdiction(_trustAnchorAddress);
        uint32 trustAnchorIndex = trustAnchorManager.getTrustAnchorIndex(_trustAnchorAddress);

        emit EVT_ReceivedJurisdictionFromTrustAnchor(jurisdiction, _trustAnchorAddress, _trustChannelAddress);

        if (trustAnchorManager.isTrustAnchorVerified(_trustAnchorAddress) && jurisdiction != NoJurisdiction) {
            uint32 trustChannelIndex = trustChannelKeccakToTrustChannelIndex[keccak256(abi.encodePacked(_trustChannelAddress))];

            //separate out the trust channel index number with the sub-mapping. this keeps alignment to 256 bits.
            //uint24 because the maximum value is the trustChannelIndex (a uint32) shifted over 8 bits.
            uint24 submapNumber = uint24(trustChannelIndex >> 8);
            uint8 subIndex = uint8(trustChannelIndex % 256);

            //when the mapping is done, it is OR'd with the 2(to the power of)trustChannelIndex, subIndex being bounded between 0->2**24-1.
            //this indicates the trust channel index in a (bounded, but still very very high) address space.

            trustAnchorIndexToTrustChannelIndexBitField[trustAnchorIndex][submapNumber] |= uint256(2 ** uint256(subIndex));

//            emit EVT_ComposedTrustChannelWithTrustAnchor(trustAnchorIndexToTrustChannelIndexBitField[trustAnchorIndex][submapNumber], trustAnchorIndex, trustChannelIndex, _trustAnchorAddress, _trustChannelAddress);

            //@note: necessary for trust anchor revocations, and attestation revocation.
            //
            //                        //separate out the trust anchor submap index with the sub-mapping. this keeps alignment to 256 bits.
            //                        uint24 submapNumber = uint24(trustAnchorIndex >> 8);
            //                        uint8 subIndex = uint8(trustAnchorIndex % 256);
            //
            //                        if (channelMap.trustAnchorIndexMapEXBitField.length < (submapNumber + 1)) {
            //                            channelMap.trustAnchorIndexMapEXBitField = submapNumber + 1;
            //                        }
            //                        //@note:@todo:@next: consider the additional complexity if the trust anchor itself is revoked.
            //                        channelMap.trustAnchorIndexMapEXBitField[submapNumber] |= (2 ** uint256(subIndex));

            //and we keep track of the highest channel index for later high-speed compares. for example larger systems
            //might require more 256 bit table lookup/compares.
            if (trustAnchorIndexAssociatedToAnyTrustChannels[trustAnchorIndex] == false) {
                trustAnchorIndexAssociatedToAnyTrustChannels[trustAnchorIndex] = true;
                trustAnchorIndexToTrustChannelLowestSubmapNumber[trustAnchorIndex] = submapNumber;
            } else {
                if (trustAnchorIndexToTrustChannelLowestSubmapNumber[trustAnchorIndex] > submapNumber) {
                    trustAnchorIndexToTrustChannelLowestSubmapNumber[trustAnchorIndex] = submapNumber;
                }
            }

            if (trustAnchorIndexToTrustChannelHighestSubmapNumber[trustAnchorIndex] < submapNumber) {
                trustAnchorIndexToTrustChannelHighestSubmapNumber[trustAnchorIndex] = submapNumber;
            }


            _channelMap.channelRules.rulesActive |= uint256(2)**uint8(trustChannelRulesEnum.AllowTransitAcrossJurisdictions);

            //@note: This part of the function appends the jurisdiction mapping within a bit field, aligned to
            // the rules storage index of the "AllowTransitAcrossJurisdictions" ruleset.

            //separate out the jurisdiction number with the sub-mapping. this keeps alignment to 256 bits.
            //@note: reusing "submapNumber" which is uint24, casting to uint8 in further.
            submapNumber = uint8(jurisdiction >> 8);
            subIndex = uint8(jurisdiction % 256);
            //when the mapping is done, it is OR'd with the 2(to the power of)subIndex, subIndex being bounded between 0->255.
            //this indicates the jurisdiction in a (bounded, but still very very high) address space.

            uint16 ruleStorageIndex = uint16(2 ** uint256(trustChannelRulesEnum.AllowTransitAcrossJurisdictions)) + uint8(submapNumber);

            _channelMap.channelRules.rulesStorage[ruleStorageIndex] |= bytes32(2 ** uint256(subIndex));

            _channelMap.trustAnchorAddressExists[_trustAnchorAddress] = true;
            addTrustAnchorToChannelMapArray(_channelMap, trustAnchorIndex);

            trustAnchorIndexNumberOfTrustChannelsAssociated[trustAnchorIndex]++;

            // setup the association mapping (the position in the array of associated indexes), for a potential removal event in the future
            trustAnchorIndexToAssociations[trustAnchorIndex].associatedTrustChannelIndexesMapping[trustChannelIndex] = trustAnchorIndexToAssociations[trustAnchorIndex].associatedTrustChannelIndexesArray.length;
            trustAnchorIndexToAssociations[trustAnchorIndex].associatedTrustChannelIndexesArray.push(trustChannelIndex);

            emit EVT_AddedTrustAnchorToTrustChannel( ruleStorageIndex,
                trustAnchorIndexToTrustChannelLowestSubmapNumber[trustAnchorIndex],
                trustAnchorIndexToTrustChannelHighestSubmapNumber[trustAnchorIndex],
                trustAnchorIndexNumberOfTrustChannelsAssociated[trustAnchorIndex],
//                trustAnchorIndex,
                _trustAnchorAddress,
                _trustChannelAddress);

            //trust anchor added to trust channel
            return true;
        } else {
            //no trust anchor jurisdiction set (trust anchor may not have been onboarded + verified either)
            return false;
        }
    }

    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @dev Gets the number of active Trust Channel administrators for this specific Trust Channel/
    /// @return result the number of active trust channel administrators for this trust channel

    function getNumActiveTrustChannelAdministratorsForTrustChannel(address _trustChannelAddress) public view returns (uint256 result) {
        return numActiveTrustChannelAdministrators[_trustChannelAddress];
    }

    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @param _keyKeccak the key for the multi-signature key-value request.
    /// @dev Gets the permission level (whether enough administrators have signed off) for the multi-signature key-value hash for this Trust Channel.
    /// @return result the the permission level of the key-value multi-signature confirmation step

    function getPermissionsForMultisignKeyForTrustChannel(address _trustChannelAddress, bytes32 _keyKeccak) internal view returns (uint256 result) {
        return trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].permissionLevel;
    }


    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @param _keyKeccak the key for the multi-signature key-value request.
    /// @dev Gets whether a specific administrator of a Trust Channel has key signatures (and what their level is) based on a specific Trust Channel address and a hash for the key-value mapping of proposals within that Trust Channel's multi-signature voting.
    /// @return result
    ///    | 0 = not trust channel administrator
    ///    | 1 = signature not found
    ///    | 2 = signature found
    ///    | 3 = access revoked


    function trustChannelAdminGetSelfConfirmedFromMultisignKey(address _trustChannelAddress, bytes32 _keyKeccak) internal view returns (uint16 result) {
        if (isTrustChannelAdministrator(msg.sender, _trustChannelAddress)) {
            if (trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].trustChannelAdministratorSignatures[msg.sender] == KeyPermissionAccess.Revoked) {
                //access revoked
                return 3;
            } else if (trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].trustChannelAdministratorSignatures[msg.sender] == KeyPermissionAccess.Signed) {
                //signature found
                return 2;
            } else {
                //signature not found
                return 1;
            }
        } else {
            //not trust channel administrator
            return 0;
        }
    }


    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @param _keyKeccak the key for the multi-signature key-value request.
    /// @dev | Allows a Trust Channel administrator to applies their signature for a specific key-value hash in the proposal array of a Trust Channel's voting.
    ///      | Gets the resultant permission level (# of Trust Channel administrators that have signed this key-value hash).
    /// @return result
    ///    | 0 = not trust channel administrator
    ///    | 1 or greater = #confirmations

    function trustChannelAdminApplyAndGetPermissionsForMultisignKey(address _trustChannelAddress, bytes32 _keyKeccak) internal returns (uint256 result) {
        if (isTrustChannelAdministrator(msg.sender, _trustChannelAddress)) {
              if (trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].trustChannelAdministratorSignatures[msg.sender] == KeyPermissionAccess.Unknown ||
                trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].trustChannelAdministratorSignatures[msg.sender] == KeyPermissionAccess.Reset) {

                trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].permissionLevel++;
                trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].trustChannelAdministratorSignatures[msg.sender] = KeyPermissionAccess.Signed;

                trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].trustChannelAdministrators.push(msg.sender);
                trustChannelAdministratorToMultisignPermissionedKeysArray[_trustChannelAddress][msg.sender].push(_keyKeccak);
              }
            //#confirmations
            return trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].permissionLevel;
        } else {
            //not trust channel administrator
            return 0;
        }
    }

    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @param _keyKeccak the key for the multi-signature key-value request.
    /// @dev Resets the permission level (and individual trust channel administrator's signature states) for the key-value hash of a specific Trust Channel proposal.
    /// @return result
    ///    | 0 = not trust channel administrator
    ///    | 1 = already reset
    ///    | 2 = reset correctly

    function trustChannelAdminResetPermissionsForMultisignKey(address _trustChannelAddress, bytes32 _keyKeccak) internal returns (uint8 result) {
        if (isTrustChannelAdministrator(msg.sender, _trustChannelAddress)) {
            if (trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].permissionLevel != 0) {
                //remove administrator references
                for (uint i = 0; i < trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].trustChannelAdministrators.length; i++) {
                    trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].trustChannelAdministratorSignatures[trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].trustChannelAdministrators[i]] = KeyPermissionAccess.Reset;
                }


                //delete the main holding array
                delete trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].trustChannelAdministrators;

                //and reset the permission level
                trustChannelAdministratorMultisignPermissionedKeys[_trustChannelAddress][_keyKeccak].permissionLevel = 0;

                //reset correctly
                return 2;
            } else {
                //already reset
                return 1;
            }
        } else {
            //not trust channel administrator
            return 0;
        }
    }



    //@note:@here:@todo:@critical:@test: write tests for this.

    //@note: This function removes a trust anchor from a trust channel. This will have ripple effects to the
    // users that the trust anchor has already attested to, potentially causing a lot of further subprocessing.
    // It is not efficient to remove attestations en-masse, and this function will have to be carefully
    // balanced towards its use-case.

    // however.

    // as the determination of how many changes can be done without incurring blockchain processing time
    // (being a local process), there is an absolute knowledge of what the ripple effect will entail.

    //@note:@todo:@critical: does the Juridiction mapping in the rules need to be checked?
    //@note:@todo:@critical: should general administrators (not just the administrators of this particular trust channel)
    // be allowed to remove a Trust Anchor if they've been Demoted in the Trust Anchor Manager contract that this contract
    // is linked to?
    //@note:@todo:@critical: make sure that submaps for trust anchor (by index) are updated for other parts of the architecture that depend on these (re: routing).


    /// @param _trustAnchorAddress The address of a Trust Anchor.
    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @dev | Allows a Trust Channel administrator to remove a Trust Anchor from a Trust Channel.
    ///      | Uses Multi-signature permissions.
    /// @notice There are many side effects from removing a Trust Anchor from a given Trust Channel. Care must be taken when doing performing this procedure.
    /// @return result
    ///    | 0 = not an administrator for this trust channel
    ///    | 1 = requires more administrator votes
    ///    | 2 = trust channel is not active
    ///    | 3 = trust anchor is not within this trust channel
    ///    | 4 = trust anchor successfully removed from trust channel

    function trustChannelAdministratorRemoveTrustAnchorFromTrustChannel(address _trustAnchorAddress, address _trustChannelAddress) public returns (uint8 result) {
        if (isTrustChannelAdministrator(msg.sender, _trustChannelAddress) == true) {
            bytes32 keyKeccak = keccak256(abi.encodePacked("removeTrustAnchorFromTrustChannelVote", _trustAnchorAddress, _trustChannelAddress));

            if (requireAndApplyTrustChannelAdministratorsConfirmation(_trustChannelAddress, keyKeccak) == true) {
                bytes32 trustChannelKeccak = trustChannelAddressToTrustChannelKeccak[_trustChannelAddress];
                trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelKeccak];

                trustChannelAdminResetPermissionsForMultisignKey(_trustChannelAddress, keyKeccak);

                if (channelMap.isActive == true) {
                    if (channelMap.trustAnchorAddressExists[_trustAnchorAddress] == true) {
                        removeTrustAnchorFromTrustChannel(_trustAnchorAddress, _trustChannelAddress);

                        //trust anchor successfully removed from trust channel
                        return 4;
                    } else {
                        //trust anchor is not within this trust channel
                        return 3;
                    }
                } else {
                    //trust channel not active
                    return 2;
                }
            } else {
                //requires more administrator votes
                return 1;
            }
        } else {
            //not an administrator for this trust channel
            return 0;
        }
    }

    //@note:@critical:@todo: allow Trust Anchors to remove themselves from trust channels?
    // in the case of a trust anchor being associated to a trust channel who's routing additions are
    // costing more gas in checks than the market can bear, the trust anchor could remove themselves
    // from the channel.

    /// @param _trustAnchorAddress The address of a Trust Anchor.
    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @dev Internal function to remove a Trust Anchor from a Trust Channel.
    /// @notice There are many side effects from removing a Trust Anchor from a given Trust Channel. Care must be taken when doing performing this procedure.

    function removeTrustAnchorFromTrustChannel(address _trustAnchorAddress, address _trustChannelAddress) internal {
        bytes32 trustChannelKeccak = trustChannelAddressToTrustChannelKeccak[_trustChannelAddress];
        trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelKeccak];

        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        channelMap.trustAnchorAddressExists[_trustAnchorAddress] = false;

        uint32 trustAnchorIndex = trustAnchorManager.getTrustAnchorIndex(_trustAnchorAddress);

        uint32 trustChannelIndex = trustChannelKeccakToTrustChannelIndex[trustChannelKeccak];

        //separate out the trust channel index number with the sub-mapping. this keeps alignment to 256 bits.
        //uint24 because the maximum value is the trustChannelIndex (a uint32) shifted over 8 bits.
        uint24 submapNumber = uint24(trustChannelIndex >> 8);
        uint8 subIndex = uint8(trustChannelIndex % 256);

        // To remove the Trust Channel mapped to the Trust Anchor, when the mapping is done, it is AND'd with
        // the negated bit field of the 2(to the power of)trustChannelIndex, subIndex being bounded between 0->2**24-1.

        trustAnchorIndexToTrustChannelIndexBitField[trustAnchorIndex][submapNumber] &= ~(uint256(2 ** uint256(subIndex)));

        channelMap.trustAnchorAddressExists[_trustAnchorAddress] = false;
        removeTrustAnchorFromChannelMapArray(channelMap, trustAnchorIndex);

        trustAnchorIndexNumberOfTrustChannelsAssociated[trustAnchorIndex]--;

        trustAnchorAssociations storage taAssociations = trustAnchorIndexToAssociations[trustAnchorIndex];

        //and we keep track of the highest channel index for later high-speed compares. for example larger systems
        //might require more 256 bit table lookup/compares.
        if (trustAnchorIndexNumberOfTrustChannelsAssociated[trustAnchorIndex] == 0) {
            // if there's no current associated trust channels, set the lookups appropriately and zero out the lowest & highest submap numbers
            trustAnchorIndexAssociatedToAnyTrustChannels[trustAnchorIndex] = false;

            trustAnchorIndexToTrustChannelLowestSubmapNumber[trustAnchorIndex] = 0;
            trustAnchorIndexToTrustChannelHighestSubmapNumber[trustAnchorIndex] = 0;
        } else {
            //@note: update the highest and lowest submap indexes. this may be computationally unfeasible in a single step with massive #'s of trust channels
            (uint24 lowestSubmapNumber, uint24 highestSubmapNumber) = calculateLowestAndHighestSubmapForTrustAnchorIndexWithRemovalOfTrustChannel(trustAnchorIndex, trustChannelIndex);

            trustAnchorIndexToTrustChannelLowestSubmapNumber[trustAnchorIndex] = lowestSubmapNumber;
            trustAnchorIndexToTrustChannelHighestSubmapNumber[trustAnchorIndex] = highestSubmapNumber;

            // swap the association array's last element with the element in the position of this removed trust channel index
            taAssociations.associatedTrustChannelIndexesArray[taAssociations.associatedTrustChannelIndexesMapping[trustChannelIndex]] = taAssociations.associatedTrustChannelIndexesArray[taAssociations.associatedTrustChannelIndexesArray.length - 1];

            // re-association the mapping (the position in the array of associated indexes), for the removed trust channel index in the trust anchor's association array.
            taAssociations.associatedTrustChannelIndexesMapping[taAssociations.associatedTrustChannelIndexesArray[taAssociations.associatedTrustChannelIndexesArray.length - 1]] = taAssociations.associatedTrustChannelIndexesMapping[trustChannelIndex];
        }

        // remove the last index in the array
        taAssociations.associatedTrustChannelIndexesArray.pop();

        emit EVT_RemovedTrustAnchorFromTrustChannel(trustAnchorIndexToTrustChannelIndexBitField[trustAnchorIndex][submapNumber], trustAnchorIndex, trustChannelIndex, _trustAnchorAddress, _trustChannelAddress);
    }

    /// @param _channelMap The Channel Map of a Trust Channel.
    /// @param _trustAnchorIndex The Index of a Trust Anchor.
    /// @dev Adds a Trust Anchor from a Trust Channel's array mapping.

    function addTrustAnchorToChannelMapArray(trustChannelMap storage _channelMap, uint32 _trustAnchorIndex) internal {
        _channelMap.trustAnchorsArray.push(_trustAnchorIndex);
        _channelMap.trustAnchorsArrayPositionMapping[_trustAnchorIndex] = _channelMap.trustAnchorsArray.length - 1;
    }

    /// @param _channelMap The Channel Map of a Trust Channel.
    /// @param _trustAnchorIndex The Index of a Trust Anchor.
    /// @dev Removes a Trust Anchor from a Trust Channel's array mapping.

    function removeTrustAnchorFromChannelMapArray(trustChannelMap storage _channelMap, uint32 _trustAnchorIndex) internal {
        uint256 curArrayPosition = _channelMap.trustAnchorsArrayPositionMapping[_trustAnchorIndex];

        uint32 lastElement = _channelMap.trustAnchorsArray[_channelMap.trustAnchorsArray.length - 1];
        _channelMap.trustAnchorsArray[curArrayPosition] = lastElement;

        _channelMap.trustAnchorsArrayPositionMapping[lastElement] = curArrayPosition;
        _channelMap.trustAnchorsArrayPositionMapping[_trustAnchorIndex] = 0;

        _channelMap.trustAnchorsArray.pop();
    }

    /// @param _trustChannelAddress The address of a Trust Channel.
    /// @dev Gets the number of Trust Anchors within the Trust Channel's associated Trust Anchor set.
    /// @return result the number of trust anchors associated to this trust channel

    function getNumberOfTrustAnchorsForTrustChannel(address _trustChannelAddress) external view override returns (uint256 result) {
        trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelAddressToTrustChannelKeccak[_trustChannelAddress]];

        return channelMap.trustAnchorsArray.length;
    }

    /// @param _trustChannelAddress The address of a Trust Channel.
    /// @param _arrayIndex The array index for the Trust Anchor it wishes to receive.
    /// @dev Gets a specific Trust Anchor by array index within the Trust Channel's associated Trust Anchors.
    /// @return result a trust anchor address

    function getTrustAnchorForTrustChannelByArrayIndex(address _trustChannelAddress, uint256 _arrayIndex) external view override returns (address result) {
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);
        trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelAddressToTrustChannelKeccak[_trustChannelAddress]];

        return trustAnchorManager.getTrustAnchorAddress(channelMap.trustAnchorsArray[_arrayIndex]);
    }

    /// @param _trustChannelAddress The address of a Trust Channel.
    /// @dev Gets all of the associated Trust Anchor Addresses for a specific Trust Channel.
    /// @return result an array of trust anchor addresses

    function getAllTrustAnchorsForTrustChannel(address _trustChannelAddress) external view override returns (address[] memory result) {
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);
        trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelAddressToTrustChannelKeccak[_trustChannelAddress]];

        address[] memory allTrustAnchors = new address[](channelMap.trustAnchorsArray.length);

        for (uint i = 0; i < channelMap.trustAnchorsArray.length; i++) {
            allTrustAnchors[i] = trustAnchorManager.getTrustAnchorAddress(channelMap.trustAnchorsArray[i]);
        }

        return allTrustAnchors;
    }

    /// @param _trustAnchorAddress The address of a Trust Anchor.
    /// @dev Gets all of the associated Trust Channel Addresses for a specific Trust Anchor.
    /// @return an array of trust channel addresses

    function getAllTrustChannelAddressesForTrustAnchor(address _trustAnchorAddress) public view returns (address[] memory) {
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        uint32 trustAnchorIndex = trustAnchorManager.getTrustAnchorIndex(_trustAnchorAddress);

        uint32[] storage allTrustChannelIndexes = trustAnchorIndexToAssociations[trustAnchorIndex].associatedTrustChannelIndexesArray;

        address[] memory allTrustChannelAddressesToReturn = new address[](allTrustChannelIndexes.length);

        for (uint32 i = 0; i < allTrustChannelIndexes.length; i++) {
            allTrustChannelAddressesToReturn[i] = trustChannelIndexToTrustChannelAddress[allTrustChannelIndexes[i]];
        }

        return allTrustChannelAddressesToReturn;
    }

    /// @param _trustAnchorAddress The address of a Trust Anchor.
    /// @dev Gets all of the associated Trust Channel Indexes for a specific Trust Anchor
    /// @return
    ///    an array of trust channel indexes

    function getAllTrustChannelIndexesForTrustAnchor(address _trustAnchorAddress) public view returns (uint32[] memory) {
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        uint32 trustAnchorIndex = trustAnchorManager.getTrustAnchorIndex(_trustAnchorAddress);

        uint32[] storage allTrustChannelIndexes = trustAnchorIndexToAssociations[trustAnchorIndex].associatedTrustChannelIndexesArray;

        uint32[] memory allTrustChannelIndexesToReturn = new uint32[](allTrustChannelIndexes.length);

        for (uint32 i = 0; i < allTrustChannelIndexes.length; i++) {
            allTrustChannelIndexesToReturn[i] = allTrustChannelIndexes[i];
        }

        return allTrustChannelIndexesToReturn;
    }

    /// @param _trustAnchorIndex The Index of a Trust Anchor.
    /// @param _trustChannelIndex The Index of a Trust Channel.
    /// @dev returns the lowest & highest submap numbers in regards to the removal of a Trust Channel from a specific Trust Anchor.
    /// @return lowestSubmapNumber = the lowest submap (bitfields of 256 members) for this trust anchor's associated trust channels
    /// @return highestSubmapNumber = the highest submap (bitfields of 256 members) for this trust anchor's associated trust channels

    function calculateLowestAndHighestSubmapForTrustAnchorIndexWithRemovalOfTrustChannel(uint32 _trustAnchorIndex, uint32 _trustChannelIndex) internal returns (uint24 lowestSubmapNumber, uint24 highestSubmapNumber) {
        // this function should never be called if there are no trust channel relationships, but if it is, return zeros for lowest & highest submap indexes.

        if (trustAnchorIndexAssociatedToAnyTrustChannels[_trustAnchorIndex] == false) {
            return (0, 0);
        } else {
            //separate out the trust channel index number with the sub-mapping. this keeps alignment to 256 bits.
            //uint24 because the maximum value is the trustChannelIndex (a uint32) shifted over 8 bits.
            uint24 submapNumber = uint24(_trustChannelIndex >> 8);
            uint8 subIndex = uint8(_trustChannelIndex % 256);

            // creates a bit field with exclusion of the trust channel like:
            // assuming trust channel in question is at position 5
            // 10011000
            //
            // does an AND like:
            // 11110111

            // ie.  10011000
            //      AND
            //      11110111
            //      --------
            //      10010000

            // the result is that the submap *still has members*, which is one of the important things to check in this case (as if it still has members, the result would be the same)

            uint256 submapPostRemoval = trustAnchorIndexToTrustChannelIndexBitField[_trustAnchorIndex][submapNumber] &= ~(uint256(2 ** uint256(subIndex)));

            // easy return if the submap still has members in it - the highest & lowest submaps have not changed for this trust anchor.
            if (submapPostRemoval != 0) {
                return (trustAnchorIndexToTrustChannelLowestSubmapNumber[_trustAnchorIndex], trustAnchorIndexToTrustChannelHighestSubmapNumber[_trustAnchorIndex]);
            } else {
                // if it doesn't have members, we need to iterate backwards (or forwards) to check for equality in the
                // lowest & highest submaps already assigned to this trust anchor

                // set the local lowest & highest submap numbers to reduce lookups further on
                lowestSubmapNumber = trustAnchorIndexToTrustChannelLowestSubmapNumber[_trustAnchorIndex];
                highestSubmapNumber = trustAnchorIndexToTrustChannelHighestSubmapNumber[_trustAnchorIndex];

                if (lowestSubmapNumber == submapNumber) {
                    // we need to find the second lowest submap number, so we iterate forwards
                    for (uint24 curSubmapNumber = lowestSubmapNumber; curSubmapNumber < highestSubmapNumber; curSubmapNumber++) {
                        // if this bitfield is not 0, there's at least one trust channel in this submap that this trust anchor is assigned to.
                        if (trustAnchorIndexToTrustChannelIndexBitField[_trustAnchorIndex][curSubmapNumber] != 0) {
                            lowestSubmapNumber = curSubmapNumber;
                            break;
                        }
                    }
                }

                if (highestSubmapNumber == submapNumber) {
                    // we need to find the second highest submap number, so we iterate backwards
                    for (uint24 curSubmapNumber = highestSubmapNumber; curSubmapNumber > lowestSubmapNumber - 1; curSubmapNumber--) {
                        // if this bitfield is not 0, there's at least one trust channel in this submap that this trust anchor is assigned to.
                        if (trustAnchorIndexToTrustChannelIndexBitField[_trustAnchorIndex][curSubmapNumber] != 0) {
                            highestSubmapNumber = curSubmapNumber;
                            break;
                        }
                    }
                }

                return (lowestSubmapNumber, highestSubmapNumber);
            }
        }
    }

    /// @param _trustAnchorAddress The Address of a Trust Anchor.
    /// @dev Gets the lowest "submap number" for a given Trust Anchor (by Address), the lowest Trust Channel "Sub-map" (256 bits) that this Trust Anchor is associated to.
    /// @return result the lowest sub-map of trust channels that this trust anchor is associated to.

    function getTrustChannelLowestSubmapNumberForTrustAnchorAddress(address _trustAnchorAddress) public view returns (uint24 result) {
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        uint32 trustAnchorIndex = trustAnchorManager.getTrustAnchorIndex(_trustAnchorAddress);

        return getTrustChannelLowestSubmapNumberForTrustAnchorIndex(trustAnchorIndex);
    }

    /// @param _trustAnchorAddress The Address of a Trust Anchor.
    /// @dev Gets the highest "submap number" for a given Trust Anchor (by Address), the highest Trust Channel "Sub-map" (256 bits) that this Trust Anchor is associated to.
    /// @return result  the highest sub-map of trust channels that this trust anchor is associated to.

    function getTrustChannelHighestSubmapNumberForTrustAnchorAddress(address _trustAnchorAddress) public view returns (uint24 result) {
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        uint32 trustAnchorIndex = trustAnchorManager.getTrustAnchorIndex(_trustAnchorAddress);

        return getTrustChannelHighestSubmapNumberForTrustAnchorIndex(trustAnchorIndex);
    }

    /// @param _trustAnchorIndex The Index of a Trust Anchor.
    /// @dev Gets the lowest "submap number" for a given Trust Anchor (by Index), the lowest Trust Channel "Sub-map" (256 bits) that this Trust Anchor is associated to.
    /// @return result  the lowest sub-map of trust channels that this trust anchor is associated to.

    function getTrustChannelLowestSubmapNumberForTrustAnchorIndex(uint32 _trustAnchorIndex) public view override returns (uint24 result) {
        return trustAnchorIndexToTrustChannelLowestSubmapNumber[_trustAnchorIndex];
    }

    /// @param _trustAnchorIndex The Index of a Trust Anchor.
    /// @dev Gets the highest "submap number" for a given Trust Anchor (by Index), the highest Trust Channel "Sub-map" (256 bits) that this Trust Anchor is associated to.
    /// @return result  the highest sub-map of trust channels that this trust anchor is associated to.

    function getTrustChannelHighestSubmapNumberForTrustAnchorIndex(uint32 _trustAnchorIndex) public view override returns (uint24 result) {
        return trustAnchorIndexToTrustChannelHighestSubmapNumber[_trustAnchorIndex];
    }

    /// @param _trustAnchorIndex The Index of a Trust Anchor.
    /// @param _submapNumber The submap number pf the Trust Channel Index bitfield within the Trust Anchor's associations of the Trust Channel.
    /// @dev Gets the 0-255 bit value of the specific Trust Channel within a "submap number" for a given Trust Anchor (by Index). By getting the sub-map (the 256 bit "page" of memory) and using this 0-255 value, the resultant combination is the exact Trust Channel index that this Trust Anchor has been associated to.
    /// @return result  the trust channel index within a specific submap that this trust anchor is associated to.

    function getTrustChannelIndexBitFieldAtSubmapNumberForTrustAnchorIndex(uint32 _trustAnchorIndex, uint24 _submapNumber) public view override returns (uint256 result) {
        return trustAnchorIndexToTrustChannelIndexBitField[_trustAnchorIndex][_submapNumber];
    }

    // ** trust channel rules ** //

    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @param _ruleIndex The index for the rule to modify the status of.
    /// @param _active A boolean to indicate whether the rule should be set, or not set.
    /// @dev | Sets a specific Rule for a Trust Channel to "on" or "off". These rules form the basis of whether a Route is successful or not given sender & receiver parameters in the Routing function.
    ///      | Uses Multi-signature permissions.
    /// @return result
    ///    | 0 = not an administrator for this trust channel
    ///    | 1 = requires more trust channel administrator votes
    ///    | 2 = trust channel rule set

    //@note:@todo:@critical: create tests for this

    function setTrustChannelRuleActive(address _trustChannelAddress, uint8 _ruleIndex, bool _active) public override returns (uint8 result) {
        if (isTrustChannelAdministrator(msg.sender, _trustChannelAddress) == true) {
            bytes32 keyKeccak = keccak256(abi.encodePacked("setTrustChannelRuleActive", _trustChannelAddress, _ruleIndex, _active));

            if (requireAndApplyTrustChannelAdministratorsConfirmation(_trustChannelAddress, keyKeccak) == true) {
                trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelAddressToTrustChannelKeccak[_trustChannelAddress]];

                trustChannelAdminResetPermissionsForMultisignKey(_trustChannelAddress, keyKeccak);

                //get the index in the bit field. ie rule #2 (starting at #1) would be (... 252 zeros ...) 0010
                uint256 ruleIndexBitfield = uint256(2)**_ruleIndex;

                if (_active == true) {
                    //do an OR operation if active
                    channelMap.channelRules.rulesActive |= ruleIndexBitfield;
                } else {
                    //otherwise do an AND with all but that bit set to 1 (ie. inverting the ruleIndexBitfield)
                    channelMap.channelRules.rulesActive &= ~ruleIndexBitfield;
                }

                //trust channel rule set
                return 2;
            } else {
                //requires more trust channel administrator votes
                return 1;
            }
        } else {
            //not an administrator for this trust channel
            return 0;
        }
    }

    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @param _ruleIndex The index for the rule to set.
    /// @param _ruleStorageSubindex The sub-index for the rule to set.
    /// @param _newValue A value to set the Rule Storage (at sub-index) to.
    /// @dev | Sets a specific Rule Storage for a Rule to a specific value, for a given Trust Channel.
    ///      | As an example, the "Rule" of how much assets can be transferred at one time can be set, with arbitrary numbers of other acceptable values or thresholds as addition "Rule Storage sub-indexes". When checking in routing function in the Shyft Core architecture, these rules can combine to form a comprehensive set of restrictions & allowances on asset transferance.
    ///      | The _newValue parameter is set as bytes in this function, but as it's a 256 value, it can be cast from any other required value type.
    ///      | Uses Multi-signature permissions.
    /// @return result
    ///    | 0 = not an administrator for this trust channel
    ///    | 1 = requires more trust channel administrator votes
    ///    | 2 = trust channel rules storage set

    //@note:@todo:@critical: create tests for this

    function setTrustChannelRulesStorage(address _trustChannelAddress, uint8 _ruleIndex, uint8 _ruleStorageSubindex, bytes32 _newValue) public override returns (uint8 result) {
        if (isTrustChannelAdministrator(msg.sender, _trustChannelAddress) == true) {
            bytes32 keyKeccak = keccak256(abi.encodePacked("setTrustChannelRulesStorage", _trustChannelAddress, _ruleIndex, _ruleStorageSubindex, _newValue));

            if (requireAndApplyTrustChannelAdministratorsConfirmation(_trustChannelAddress, keyKeccak) == true) {
                trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelAddressToTrustChannelKeccak[_trustChannelAddress]];

                channelMap.channelRules.rulesStorage[_ruleStorageSubindex] = _newValue;

                trustChannelAdminResetPermissionsForMultisignKey(_trustChannelAddress, keyKeccak);

                //trust channel rules storage set
                return 2;
            } else {
                //requires more trust channel administrator votes
                return 1;
            }
        } else {
            //not an administrator for this trust channel
            return 0;
        }
    }

    /// @param _trustChannelAddress An ethereum-compatible address, used to identify this Trust Channel.
    /// @param _ruleIndex The index for the rule to set.
    /// @param _ruleStorageSubindex The sub-index for the rule to set.
    /// @dev | Gets a specific Rule Storage for a Rule to a specific value, for a given Trust Channel.
    ///      | The returned results parameter is set as bytes in this function, but as it's a 256 value, it can be cast to any other required value type later on in the Shyft Core architecture.
    /// @return result
    ///    | n = rules storage value

    //@note:@todo:@critical: create tests for this

    function getTrustChannelRulesStorage(address _trustChannelAddress, uint8 _ruleIndex, uint8 _ruleStorageSubindex) public view override returns (bytes32 result) {
        trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelAddressToTrustChannelKeccak[_trustChannelAddress]];

        return channelMap.channelRules.rulesStorage[_ruleIndex * uint16(256) + _ruleStorageSubindex];
    }

    /// @param _trustChannelIndex An Index used to identify this Trust Channel.
    /// @param _ruleIndex The index for the rule to set.
    /// @param _ruleStorageSubindex The sub-index for the rule to set.
    /// @dev | Gets a specific Rule Storage for a Rule to a specific value, for a given Trust Channel (by Index).
    ///      | The returned results parameter is set as bytes in this function, but as it's a 256 value, it can be cast to any other required value type later on in the Shyft Core architecture.
    /// @return result
    ///    | n = rules storage value

    //@note:@todo:@critical: create tests for this

    function getTrustChannelRulesStorage(uint32 _trustChannelIndex, uint8 _ruleIndex, uint8 _ruleStorageSubindex) public view override returns (bytes32 result) {
        trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelIndexToTrustChannelKeccak[_trustChannelIndex]];

        return channelMap.channelRules.rulesStorage[_ruleIndex * uint16(256) + _ruleStorageSubindex];
    }

    /// @param _trustChannelIndex An Index used to identify this Trust Channel.
    /// @dev | Gets the active Trust Channel Rules for this Trust Channel (by Index). This is used by Route functions in the Shyft Core Architecture.
    /// @return result
    ///    | 0 = [ channel doesn't exist, 0 ]
    ///    | 1 = [ channel is not active, bit field of the rules that are active ]
    ///    | 2 = [ channel active, bit field of the rules that are active ]
    /// @return channelRulesBitField the channel rules bitfield

    //@note:@todo:@critical: create tests for this and all the cases/configurations

    function getActiveChannelRulesBitField(uint32 _trustChannelIndex) public view override returns (uint8 result, uint256 channelRulesBitField) {
        trustChannelMap storage channelMap = trustChannelKeccakToTrustChannelMap[trustChannelIndexToTrustChannelKeccak[_trustChannelIndex]];
        trustChannelRules storage channelRules = channelMap.channelRules;

        if (channelMap.doesExist == true) {
            if (channelMap.isActive == true) {
                //channel active, returned channel map
                return (2, channelRules.rulesActive);
            } else {
                //channel is not active, returned channel map
                return (1, channelRules.rulesActive);
            }
        } else {
            //channel doesn't exist
            return (0, 0);
        }
    }

    /// @param _trustChannelKeccak A Keccak Hash used to identify this Trust Channel.
    /// @dev Gets the Trust Channel Keccak Index for a specific Trust Channel Hash.
    /// @return result the trust channel index

    function getTrustChannelIndexFromTrustChannelKeccak(bytes32 _trustChannelKeccak) public view override returns (uint32 result) {
        return trustChannelKeccakToTrustChannelIndex[_trustChannelKeccak];
    }

    /// @param _trustChannelIndex An Index used to identify this Trust Channel.
    /// @dev Gets the Trust Channel Hash for a specific Trust Channel Keccak Index.
    /// @return result  the trust channel keccak hash

    function getTrustChannelKeccakFromTrustChannelIndex(uint32 _trustChannelIndex) public view override returns (bytes32 result) {
        return trustChannelIndexToTrustChannelKeccak[_trustChannelIndex];
    }

    // get trustAnchorIndexNumberOfTrustChannelsAssociated[trustAnchorIndex]--;
    // get trustAnchorIndexAssociatedToAnyTrustChannels[trustAnchorIndex]
}

